import React, { useState, useEffect } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";
import "./adduser.css";
import axios from "axios";
import { toast, Toast } from "react-toastify";

const initialState = {
  FirstName: "",
  LastName: "",
  Location: "",
  Email: "",
  DOB: "",
  Education: "",
};

const Adduser = () => {
  const [state, Setstate] = useState(initialState);
  const { FirstName, LastName, Location, Email, DOB, Education } = state;
  const navigate = useNavigate();
  const handleSubmit = (e) => {
    e.preventDefault();
    if (!FirstName || !LastName || !Location || !Email || !DOB || !Education) {
      toast.error("please provide value into each input field");
    } else {
      axios
        .post("http://localhost:5000/api/post", {
          FirstName,
          LastName,
          Location,
          Email,
          DOB,
          Education,
        })
        .then(() => {
          Setstate({
            FirstName: "",
            LastName: "",
            Location: "",
            Email: "",
            DOB: "",
            Education: "",
          });
        })
        .catch((err) => toast.error(err.res.data));
      setTimeout(() => navigate("/"), 500);
    }
  };
  const handleInputChange = (e) => {
    const { FirstName, LastName, Location, Email, DOB, Education, value } =
      e.target;
    Setstate({
      ...state,
      [FirstName]: value,
      [LastName]: value,
      [Location]: value,
      [Email]: value,
      [DOB]: value,
      [Education]: value,
    });
  };
  return (
    <div className="container">
      <h2>Add Student Details</h2>
      <form onSubmit={handleSubmit}>
        <div className="Container">
          <label >FirstName :</label>
          <input id="fname" name="fname" type="text" value={FirstName} placeholder="Enter your first name"  onChange={handleInputChange}/>
        </div>
        <div>
          <label> FirstName</label>
          <input id type="text"  value={LastName} placeholder="Enter your last name"/>
        </div>
        <div>
          <label>LastName</label>
          <input />
        </div>
        <div>
          <label>Location</label>
          <input />
        </div>
        <div>
          <label>Email</label>
          <input />
        </div>
        <div>
          <label>DOB</label>
          <input />
        </div>
        <div>
          <label>Education</label>
          <input />
        </div>
      </form>
    </div>
  );
};

export default Adduser;

